import React from "react";
import "./App.css";
import TranslitTextBox from "./TranslitTextBox";

function App() {
  return (
    <div className="App">
      <header>WELCOME TO TRANSLIT APP</header>

      <div className="App-Component">
        <div className="App-Component">
          <TranslitTextBox />
        </div>
      </div>
    </div>
  );
}

export default App;
